INSERT [dbo].[Setting] ([Id], [StationId], [Key], [Value], [Culture]) VALUES (32, 3, N'Bkm_Explaination', N'<p class="bkmP" style="text-align:left">
        BKM Express ile ödeme yaparken www.bkmexpress.com.tr sayfasına yönlendirileceksiniz.
    </p>
	<p style="text-align:left">
        Bu kampanya Biggshop’ın diğer kurumlar ile  gerçekleştirdiği indirim kampanyaları ile birleştirilemez.
    </p>
    <p style="text-align:left">
        BKM Express sitesine üye olurken kullandığınız kullanıcı adı ve şifreniz ile uygulamaya giriş yapabilir ya da yeni bir kullanıcı hesabı oluşturabilirsiniz.
    </p>
    <p style="text-align:left">
        Karşınıza gelen ödeme ekranından işlem yapmak istediğiniz kartı ve ödeme şeklini seçerek kolayca ödeme yapabilirsiniz.
    </p>
    <p style="text-align:left">
        Alışverişinizi tamamladıktan sonra otomatik olarak siteye döneceksiniz.
    </p>', N'tr-TR')
GO
